package alg2;import java.util.Date;import java.util.Random;public class TestKey implements Keyable {                private static Random rand = new Random(new Date().getTime());        private static long nrCounter = 0;        private int myKey;        private long myNr;                                public TestKey() {            myKey = rand.nextInt(Integer.MAX_VALUE);            myNr = nrCounter;            nrCounter++;        }        @Override        public int getKey() {                        return myKey;        }}